import './App.js'
import createSudoku  from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()
let count=0;
let temp=JSON.parse(JSON.stringify(sudoku));
for(let i=0;i<temp.length;i++)
{
  for(let j=0;j<temp[i].length;j++)
  temp[i][j]=count++;
}
const root=ReactDOM.createRoot(document.getElementById('root'));
class Start extends React.Component{
  constructor(){
    super()
  }
  func=()=>{
    root.render(<Sudoku arr={sudoku} />)
  }
  render(){
    return (<button className='startButton'onClick={this.func}>
      CLICK TO START
    </button>)
  }
}
count=0;
let render=(arr)=>{
  let fin=[]
  fin.push(arr.map((arr,index)=>t(arr,index)))
  return fin;
}
let t=(arrr,i)=>{
  let fin=[]
  fin.push(arrr.map((val,index)=>{
    if(val==-1)
    return <Input className="Element1" r={i}c={index}/>
    else
    return <Element className="Element"val={val}/>
  }))
  return fin;
}
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props);
     }

     render(){
       return (<div className='Sudoku'>
        {render(this.props.arr)}
      </div>)
     }
}
